import React from 'react';
import '../styles.css';
import 'bootstrap/dist/css/bootstrap.min.css';
//import Navbar from '../components/NavBar'
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { Link, Route, Switch, Redirect } from 'react-router-dom';

import Home  from '../views/Home'
import About from '../views/About'
import Current from '../views/Current'
import Portfolio from '../views/Portfolio'

const sections = [
  {title: 'Home', route:'/home', component: <Home />}, 
  {title: 'About', route:'/about', component: <About />}, 
  {title: 'Currently Reading', route:'/current', component: <Current />}, 
  {title: 'Portfolio', route:'/portfolio', componen: <Portfolio />},
]

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      currentRoute: "",
    }
  }

  render() {
    return (
      <div className="App">
        {/* <Navbar sections={sections} /> */}
        <Navbar bg="dark" expand="lg" variant="dark" className="flex justify-content-between">
          <Navbar.Brand href="#home">Molly N Weybright</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
            {sections.map((section) => (
              <Nav.Link active as={Link} to={section.route}>
                {section.title}
              </Nav.Link>
            ))}
            </Nav>
          </Navbar.Collapse>
        </Navbar>
        <div>
            <Switch>
              <Redirect from="/" exact to="/home" />
              {sections.map((section) => (
                <Route exact path={section.route}>
                  {section.component}
                </Route>
              ))}
            </Switch>
        </div>
        {/* <Footer /> */}
      </div>
    );
  }
}

export default App;
